import React from "react";
import { Link } from "react-router-dom";
import { myObj } from "../constants/movieDB";

const MovieList = () => {
  const { movies } = myObj;
  console.log(movies);

  const renderList = () => {
    return movies.map((movie) => {
      <div>
        <div>{movie.title}</div>
        <div>{movie.language}</div>
      </div>;
    });
  };
  return <div>{renderList()}</div>;
};

export default MovieList;
